import AppBar from './components/AppBar'

function App() {
  return (
    <div className="App">

      <header>
      <AppBar></AppBar>

      </header>

      <nav></nav>

      <section></section>
      <footer></footer>

      <button type="button" class="btn btn-success">Success</button>


    </div>
  );
}

export default App;
